import "./PokeCard.css";

function Topo() {
  return (
    <div className="header">
      <div ClassName="">
        <img
          src="https://i2.wp.com/multarte.com.br/wp-content/uploads/2019/03/pokemon-png-logo.png?fit=2000%2C736&amp;ssl=1"
          alt="pokeapi"
        ></img>
      </div>
    </div>
  );
}

export default Topo;
